  false,\n\t\"url\": null,\n\t\"notes\": \"Location is Lat. 41u00b0 12 u201914u201d
  N Long. 91u00b0 7u2019 6u201d W near Wapello, Iowa in Wapello County at Schafer
  Landing near Port Louisa National Wildlife Refuge. Gage is mounted in a tree in
  the woods south of the Schafer Landing staff plate. Maximum Surface area of Lake
  Odessa is approximately 6,800 acres. The period of record for our surface water
  record is November 2011 to present. Gage site was updated to a Sutron SatLink datalogger
  on September 17, prior to upgrade date a Design Analysis datalogger recorded water
  levels. Dataloggers in communication with a KPSI transducer mounted to fence post
  in lakeu2010bottom. Instruments are powered by a 12V battery run to a solar panel,
  which is mounted to the antenna mast. Stage data is collected in 15u2010minute intervals.
  Weekly gage data available online, NWS ID ODSI4. Datum of gage is an assumed 530
  ft. Recorded supported by Port Louisa NWR in cooperation of Iowa Department of Natural
  Resources. Records coded fair for 2013 calendar year. Extremes for period of record
  are maximum gage height, 549.29 ft, April 22, 2013; minimum gage height, 532.80
  ft, August 3, 2012. Extremes for current year are Maximum gage height, 549.29 ft,
  April 22; minimum gage height, 532.91 ft, August 29.\",\n\t\"license_title\": \"License
